import React, { useState } from 'react';
import {BrowserRouter} from 'react-router-dom';
import NavBar from "./components/NavBar";
import Routes from "./Router/Routes";

function App() {

  return (
      <BrowserRouter>
          <div className="App site">
            <NavBar/>
            <Routes/>
          </div>
      </BrowserRouter>      
  );
}

export default App;
